import styled from 'styled-components';

export const Container = styled.div`
  max-width: 600px;
  margin: auto;
  flex-direction: column;
  background: linear-gradient(-90deg, #7159c1, #ab59c1);
`;
export const Input = styled.input`
  width: 150px;
  height: 25px;
`;
